import './ProjectTile.css';
import SkillTile from './SkillTile';
import tempimage from "./leeskatepic.jpg"

const ProjectTile = ({title, desc, pic}) => {
	return (
		<div className="projecttile">

      <img src={tempimage} id='image'/>

      <div id='projectdescription'>

        <div id='projecttitle'>
          {title}
        </div>
        
        <div id='projectsubtitle'>
          <ul className='d'>
            {desc.map(element => (
              <li className='graytext'>{element}</li>
            ))}
          </ul>
        </div>

      </div>

      <div id='lang'>
        <SkillTile />
      </div>
		</div>
	)
};

export default ProjectTile;
